  useEffect(() => {
    fetch("/members").then(
      res => res.json()
    )
    .then(data => {
      for (var i =0; i<Object.keys(data.title).length; i++){
      setMeme(preState => [
        ...preState, {media:data.media[Number.toString(i)],
      score:data.score[Number.toString(i)],
    title:data.title[Number.toString(i)]}
      ])
    }
    })

  },[])

  useEffect(() =>{
    console.log(meme)
  },[meme])

  return (
    <div className="App">
      <header className="App-header">

      </header>
    </div>
  );
}

export default App;
